 */
const Contacts = () => {
    return <div>
        <Carousel>

            <CarouselItem>Item 1</CarouselItem>
            <CarouselItem>Item 2</CarouselItem>
            <CarouselItem>Item 3</CarouselItem>
        </Carousel>


    </div>;
}

Contacts.propTypes = propTypes;
Contacts.defaultProps = defaultProps;
// #endregion

export default Contacts;
